import "./Supermarket.css";

const Supermarket = () => {
  return (
    <div className="backgroundSuper">
      <div className="bannerSuper" id="landing">
        Supermarket
      </div>
      <div className="superContainer">
        <p>
          There are 3 supermarket near the structure, you can find links below to get driving directions. <br />
          You can simply click on the link you want and open your preferred map app.
        </p>
          <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"> COOP Supermarket </a>
          <br />
          <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"> EuroSpin Supermarket </a>
          <br />
          <a href="http://maps.apple.com/?q=37.08825761369096,15.159846916778568" rel="noreferrer" target="_blank"> Penny Supermarket </a>
      </div>
    </div>
  );
};

export default Supermarket;
